import {Link} from 'react-router-dom'

export default function Hauses() {

    const [hauses,setHauses] =useState([])


    useEffect (()=>{

        const fetchData = async ()=>{

            const res = await fetch('http://localhost:4000/hauses')
            const data = await res.json();

            setHauses(data);

        }



        fetchData();
    },[])








  return (
    <div>Hauses</div>
  )
}
